    <article>
      <input
        type="checkbox"
        onClick={() => deleteTodoItem(item.id)}
        className="checkbox"
      />
      <h3>{todoName}</h3>
      <button className="edit" onClick={() => editTodo(item.name, item.id)}>
        Edit
